import React from 'react'
import { useHistory } from "react-router-dom"
const Header = () => {
    let history = useHistory()
    const handleAddJob = () => {
        history.push(`/add-job`)
    };
    return (
        <>
        <div className="container"> 
        <div class="header-child"><h1 className="text-center">Product Roles </h1> </div>
        <div class="header-child">  <button onClick={(e)=> handleAddJob(e)} className="pull-right btn btn-warning ">Post a job</button> </div>
        </div>


        </>
    )
}

export default Header;
